INSERT INTO `manage_craft_node` VALUES (33,'','工艺节点报警',1,126,'2h','工艺节点报警',0,'工艺节点报警','工艺节点报警',1,'2024-11-26 14:13:22',NULL,NULL,1),(34,'','工艺报警报警',1,126,'5min','工艺报警报警',0,'工艺报警报警','工艺报警报警',1,'2024-11-26 14:17:16',NULL,NULL,1),(35,'','隔离器工艺',1,134,'1h','运行状态',0,'定期检查手套箱和隔离器密封状态，及时更换有破损的配件。','启动操作，运行操作， 停机操作',1,'2024-11-29 10:35:36',1,'2024-11-29 15:36:44',0),(36,'','隔离器工艺',5,134,'2h','运行状态',1,'禁止在隔离器内部存放与当前操作无关的物品，避免污染或干扰。','启动操作，运行操作， 停机操作',1,'2024-11-29 10:38:21',1,'2024-12-03 15:59:32',0),(37,'','灭活罐工艺',1,135,'5h','工艺标签',0,'用于病毒灭活的专用设备，通常应用于生物制药过程中处理液体或悬浮液，以保证病毒被有效灭活，同时保留产品活性。主要用于生产高风险药物（如血液制品、疫苗、抗体等）中的病毒失活步骤。','物料加注，灭活操作，参数监控，灭活结束',1,'2024-11-29 10:48:37',1,'2024-11-29 15:41:06',0),(38,'','灭活罐工艺',2,135,'10h','工艺标签',1,'用于病毒灭活的专用设备，通常应用于生物制药过程中处理液体或悬浮液，以保证病毒被有效灭活，同时保留产品活性。主要用于生产高风险药物（如血液制品、疫苗、抗体等）中的病毒失活步骤。','物料加注，灭活操作，参数监控，灭活结束',1,'2024-11-29 10:50:22',NULL,NULL,0),(39,'','篮式反应器工艺',3,136,'10h','工艺标签',1,'主要用于生物制药、化工及其他工业中，用于物料的混合、反应及溶解操作。设备通常由罐体、搅拌装置、温控系统（夹套加热或冷却）、压力控制系统等组成。','物料加入，加热或冷却反应，反应过程中搅拌控制，液体或固体分离与过滤，清洗与设备复位。',1,'2024-11-29 10:53:17',1,'2024-11-29 16:38:31',1),(40,'','超低温冰箱获取毒种',2,134,'15min','易冻伤',1,'穿戴适当的个人防护装备，包括防寒手套（最好是厚的、隔热的手套，以防止手部冻伤）、实验服等；准备好用于转移实验耗材的工具，如预冷的镊子（如果需要夹取小型耗材，如小瓶、小管等）。','操作前准备：人员防护，工具准备；开启冰箱门，查找目标毒种；使用工具取出，转移至保温容器；关闭冰箱，处理耗材。',1,'2024-12-03 15:37:36',NULL,NULL,0),(41,'','生物隔离器传递仓处理',3,134,'30min','无菌操作',0,'记录操作过程和设备状态。包括操作的内容、使用的材料、设备是否出现异常情况等信息，为后续的实验分析和设备维护提供参考','设备检查；物品准备；人员准备；无菌操作；操作规范；内部清理；设备维护',1,'2024-12-03 15:41:38',NULL,NULL,0),(42,'','生物隔离器主舱体处理',4,134,'20min','无菌操作',1,'检查生物隔离器的完整性。查看隔离器的外壳是否有损坏、裂缝或泄漏的迹象。确保隔离器的手套完好无损，没有破损、裂缝或老化','在隔离器内进行操作时，要严格遵守无菌操作原则。如果不小心接触到非无菌表面，应该立即更换工具或对工具进行消毒处理。',1,'2024-12-03 15:44:39',1,'2024-12-21 11:24:25',0),(44,'','初步分离',1,140,'18min','分离',0,'过滤操作时，要确保样品均匀地分布在滤膜表面，避免局部压力过高导致膜破裂。压力是过滤过程中的重要参数，不同的过滤方式和膜材料有不同的压力耐受范围。','微滤操作时，跨膜压差一般较低，而超滤可能需要更高的压力来驱动液体通过膜，但也要防止压力过高损坏膜结构。同时，要注意过滤过程中的通量变化，当通量下降到一定程度（如由于膜堵塞）时，可能需要对膜进行清洗或更换',1,'2024-12-22 22:35:04',NULL,NULL,0),(45,'','中级纯化',2,140,'15min','纯化',0,'将样品上样到填充有离子交换介质的层析柱后，未结合的杂质可以通过洗涤步骤去除。然后通过改变洗脱液的性质来洗脱目标产物。洗脱条件的优化是关键，包括洗脱液的离子强度（如使用氯化钠梯度洗脱）、pH 值变化等','采用线性盐梯度洗脱可以使不同电荷强度的蛋白质依次从柱上洗脱下来，通过监测洗脱液中的蛋白质含量（如通过紫外吸收检测）和收集不同的洗脱峰，可以分离得到目标蛋白质',1,'2024-12-22 22:36:22',NULL,NULL,0),(46,'','精细纯化与抛光',3,140,'25min','精细纯化',0,'通过优化有机溶剂的梯度洗脱程序，可以实现目标产物的高纯度分离','在蛋白质或肽类药物的纯化中，从低浓度有机溶剂开始洗脱，逐渐增加有机溶剂的比例，使不同疏水性的杂质和目标产物依次洗脱，经过多次优化梯度条件，可以得到高纯度的产品。同时，要注意有机溶剂的性质和浓度对目标产物活性的影响，避免在纯化过程中导致产物失活',1,'2024-12-22 22:38:47',NULL,NULL,0),(47,'','质量检测与验证',4,140,'20min','检测',0,'建立产品活性的标准曲线和参考标准品，将检测结果与之对比，以确定产品是否达到预期的活性水平','在疫苗生产中，要检测疫苗抗原的免疫原性，通过动物实验或体外免疫细胞刺激实验，与标准疫苗的免疫效果进行对比，确保疫苗的有效性',1,'2024-12-22 22:40:57',NULL,NULL,0);
